import axios from "axios";

export const postRequest = async (url, header, data) => {
  const request = {
    method: "post",
    header: header,
    url: url,
    data: data,
  };

  await axios(request)
    .then((res) => {
      console.log(res.data);
      return res.data;
    })
    .catch((e) => {
      console.log(e);
      return e;
    });

  //return response;
};
